import React from 'react'
import StateParksList from './StateParksList'
import '../styles/StateParks.css'

function StateParks({ stateParks, showStateParks, setShowStateParks }) {
  console.log(stateParks)

  function closeParkDetails() {
    setShowStateParks(!showStateParks)
  }

  const stateParksList = stateParks.map((park) => {
    return <StateParksList key={park.id} name={park.fullName} url={park.url} />
  })

  return (
    <div className='modal'>
      <div className='modal-content'>
        <button onClick={closeParkDetails}>Close Details</button>
        {stateParksList}
      </div>
    </div>
  )
}

export default StateParks
